import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import { series } from "./seriesInfo";

function ncard(val, index, series) {
  return (
    <Card
      imgsrc={series[index].image}
      title={series[index].title}
      Sname={series[index].Sname}
      link={series[index].link}
    />
  );
}

ReactDOM.render(
  <>
    <div className="heading">Best Series on Netflix and Amazon</div>

    <div className="cardContainer">
    series.map(ncard);</div>
  </>,
  document.getElementById("root")
);
